export default function GetIssues({ page}) {
    const apiUrl = `http://localhost:3000/issues?page=${page}`;

    console.log("hola")
    return fetch(apiUrl)
      .then(res => res.json())
      .then((data)=>{
        return data
      })
      .catch((error) => {
        console.error(error);
      })
}
